import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";
import Button from 'react-bootstrap/Button';
import { FaUserCircle } from "react-icons/fa";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Container fluid className="cont">
          <Row>
            <Col sm={8}>
			<FaUserCircle color="dodgerblue" size={80}/>
              <input type="text" placeholder="Enter First Name"></input>
              <input type="text" placeholder="Enter Last Name"></input>
              <input type="email" placeholder="Enter Email"></input>
              <input type="text" placeholder="Enter Your Number"></input>
              <Button variant="success" className="but">SUBMIT</Button>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default App;
